After examining the four possible top‐level rules for S:

 1. S → NT50 NT13  
 2. S → NT3 NT64  
 3. S → NT31 NT39  
 4. S → NT24 NT20  

we check the first terminal of the target string, t12, against the possible first terminals each of those nonterminals can ever produce.  In every case you find:

 – NT50’s left‐most terminal can only be one of {t2,t26,t38,t39,t45,t59,t63,t54,t61,t64,…}  
 – NT3’s can only be {t50,t61,t2,t26}  
 – NT31’s can only be {t9,t50,t61,t2,t26}  
 – NT24’s can only be {t32}  

None can ever begin with t12.  Hence the grammar cannot generate a string starting with t12.  

